  \"2015-09-26T22:59:06.291864\",\n\t\"name\": \"partial-pressure-or-fugacity-of-carbon-dioxide-dissolved-inorganic-carbon-temperature-salinity-f518d\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0114999 includes chemical,
  discrete sample, physical and profile data collected from JAMES CLARK ROSS in the
  South Atlantic Ocean from 1995-03-20 to 1995-05-06 and retrieved during cruise WOCE_A23.
  These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113),
  CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DELTA HELIUM-3, DISSOLVED
  INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NEON, NITRATE
  + NITRITE CONTENT (CONCENTRATION), PHOSPHATE, Partial pressure (or fugacity) of
  carbon dioxide, Potential temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen
  isotope) and WATER TEMPERATURE. The instruments used to collect these data include
  CTD and bottle. These data were collected by Brian A. King of National Oceanography
  Centre, Southampton as part of the WOCE_A23 data set.nnThe World Ocean Circulation
  Experiment (WOCE) was a major component of the World Climate Research Program with
  the overall goal of better understanding the ocean's role in climate and climatic
  changes resulting from both natural and anthropogenic causes. The CO2 survey took
  advantage of the sampling opportunities provided by the WOCE Hydrographic Program
  (WHP) cruises during this period between 1990 and 1998. The final collection covers
  approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"license_title\": null,\n\t\"extras\":
